    protected void doRun()
{
    RMarketCandlesLoad runObject = new RMarketCandlesLoad();
    runObject.parmMarketId(marketId);
    runObject.parmSymbolId(symbolId);
    runObject.parmInterval(interval);
    runObject.parmDtFrom(dtFrom);
    runObject.parmDtTo(dtTo);

    runObject.run();
}
